import { Link } from 'react-router-dom';
import './SelectUser.css'

function SelectUser() {
    return (
        <div className="container">
            <div className="row text-center justify-content-start">
                <div className="selector-container shadow col-lg-4 col-sm-12">
                    <Link to="/"><img className="w-25" alt="user" src="https://res.cloudinary.com/getapet/image/upload/v1618902177/web%20sources/teamwork_jqxzg6.png"/></Link>
                </div>
                <div className="selector-container shadow col-lg-4 col-sm-12">
                    <Link to="/"><img className="w-25" alt="shelter" src="https://res.cloudinary.com/getapet/image/upload/v1618902177/web%20sources/animal-shelter_bz8fod.png"/></Link>
                </div>
            </div>
        </div>

    );
}

export default SelectUser;
